(96,1,'2019-03-18 18:37:22','2019-03-18 21:37:22','Los frutos secos son llamados así porque todos tienen una característica en común: en su composición natural tienen menos de un 50 % de agua. Son alimentos muy energéticos, ricos en grasas, en proteínas, así como en oligoelementos','','','publish','closed','closed','','96','','','2019-03-20 10:35:41','2019-03-20 13:35:41','',0,'https://tienda.programadorinformatico.cl/?p=96',2,'nav_menu_item','',0),
