(140,1,'2019-03-19 17:44:58','2019-03-19 20:44:58','<span id=\"bcr_rptStory_cslStory_0\">Un cuarto de taza de nueces, por ejemplo, ofrece más de 100 por ciento del valor diario recomendado de grasas omega-3 de origen vegetal, junto con grandes cantidades de cobre, manganeso, molibdeno, y biotina. </span><span id=\"bcr_rptStory_cslStory_1\">Las nueces pueden ayudar a reducir no sólo el riesgo de cáncer de próstata, sino también el cáncer de mama. </span><span id=\"bcr_rptStory_cslStory_2\">Las nueces contienen el aminoácido L-arginina, que ofrece múltiples beneficios vasculares a las personas con enfermedades del corazón, o los que tienen mayor riesgo de enfermedades del corazón debido a múltiples factores de riesgo cardíaco. </span><span id=\"bcr_rptStory_cslStory_3\">Las nueces contienen varios antioxidantes poderosos y únicos que están disponibles sólo en algunos alimentos de consumo habitual. </span><span id=\"bcr_rptStory_cslStory_4\">Las nueces pueden mejorar la calidad del esperma, ayudar a controlar el peso, y ofrecer apoyo a la salud del cerebro y la diabetes tipo 2</span>','Nueces','<ul>\r\n 	<li><span id=\"bcr_rptStory_cslStory_0\">Un cuarto de taza de nueces, por ejemplo, ofrece más de 100 por ciento del valor diario recomendado de grasas omega-3 de origen vegetal, junto con grandes cantidades de cobre, manganeso, molibdeno, y biotina. </span><span id=\"bcr_rptStory_cslStory_1\">Las nueces pueden ayudar a reducir no sólo el riesgo de cáncer de próstata, sino también el cáncer de mama.</span></li>\r\n</ul>','inherit','closed','closed','','94-autosave-v1','','','2019-03-19 17:44:58','2019-03-19 20:44:58','',94,'https://tienda.programadorinformatico.cl/2019/03/19/94-autosave-v1/',0,'revision','',0),
